import React from "react";
import circleLogo from "./images/circleLogo.jpg";
const SplashScreen = () =>{
    return(
        <>
            <img src={circleLogo} alt="LearnHyve Logo" id="circleLogo" />
        </>
    )
}

export default SplashScreen;
